import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expense = [
    {
      id: 1,
      expenseDate: new Date(2021, 2, 28),
      title: 'Car Insurance',
      amount: 297.67,
    },
    {
      id: 2,
      expenseDate: new Date(2021, 2, 28),
      title: 'Car Insurance',
      amount: 297.67,
    },
    {
      id: 3,
      expenseDate: new Date(2021, 2, 28),
      title: 'Car Insurance',
      amount: 297.67,
    },
    {
      id: 4,
      expenseDate: new Date(2021, 2, 28),
      title: 'Car Insurance',
      amount: 297.67,
    },
  ]
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expense[0].title} amount={expense[0].amount} date={expense[0].expenseDate}/>
      <ExpenseItem title={expense[1].title} amount={expense[1].amount} date={expense[1].expenseDate}/>
      <ExpenseItem title={expense[2].title} amount={expense[2].amount} date={expense[2].expenseDate}/>
      <ExpenseItem title={expense[3].title} amount={expense[3].amount} date={expense[3].expenseDate}/>
    </div>
  );
}

export default App;
